import React from "react";
import "./App.css";

function App() {
  const user = {
    username: "JohnDoe",
    points: 1250
  };

  // Tables on the left
  const global = [
    { rank: 1, name: "Alice", points: 3000, organization: "Org A" },
    { rank: 2, name: "Bob", points: 2700, organization: "Org B" },
    { rank: 3, name: "Charlie", points: 2500, organization: "Org C" }
  ];

  const organization = [
    { rank: 1, name: "Daniel", points: 2000, organization: "Org X" },
    { rank: 2, name: "Eve", points: 1800, organization: "Org X" },
    { rank: 3, name: "Frank", points: 1500, organization: "Org X" }
  ];

  const friends = [
    { rank: 1, name: "George", points: 900, organization: "Org Z" },
    { rank: 2, name: "Hannah", points: 850, organization: "Org Y" },
    { rank: 3, name: "Ian", points: 800, organization: "Org W" }
  ];

  // NEW: Last 5 matches
  const matches = [
    { no: 1, points: 30, score: "10-5", date: "2025-01-04" },
    { no: 2, points: 40, score: "8-6", date: "2025-01-02" },
    { no: 3, points: 20, score: "7-3", date: "2024-12-30" },
    { no: 4, points: 25, score: "9-4", date: "2024-12-28" },
    { no: 5, points: 35, score: "11-9", date: "2024-12-26" }
  ].slice(0, 5); // Only show last 5

  const renderTable = (title, data) => (
    <div className="table-section">
      <h2 className="table-title">{title}</h2>

      <table className="custom-table">
        <thead>
          <tr>
            <th>Rank</th>
            <th>Name</th>
            <th>Points</th>
            <th>Organization</th>
          </tr>
        </thead>

        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              <td>{row.rank}</td>
              <td>{row.name}</td>
              <td>{row.points}</td>
              <td>{row.organization}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );

  return (
    <div className="page-container">

      {/* Top-left user bar */}
      <div className="user-bar">
        <span className="user-text">User: {user.username}</span>
        <span className="user-text">Points: {user.points}</span>
      </div>

      {/* Two columns: left tables + right matches */}
      <div className="dashboard-row">

        {/* LEFT SIDE: existing 3 tables */}
        <div className="tables-wrapper">
          {renderTable("Global Leaderboard", global)}
          {renderTable("Organization", organization)}
          {renderTable("Friends", friends)}
        </div>

        {/* RIGHT SIDE: matches table */}
        <div className="matches-wrapper">
          <h2 className="table-title">Last 5 Matches</h2>

          <table className="custom-table">
            <thead>
              <tr>
                <th>No</th>
                <th>Points</th>
                <th>Score</th>
                <th>Date</th>
              </tr>
            </thead>

            <tbody>
              {matches.map((match, index) => (
                <tr key={index}>
                  <td>{match.no}</td>
                  <td>{match.points}</td>
                  <td>{match.score}</td>
                  <td>{match.date}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

      </div>
    </div>
  );
}

export default App;
